import React from 'react';
import ImageButton from '../atoms/imageButton';
import './sidebar.css';
import FriendImg from '../../resource/image/friendIcon.png';
import ChatImg from '../../resource/image/chatIcon.png'
import {BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import FriendView from '../../pages/mainBoard/View/friendView'

function Header() : any {
  const btnCss = {
    'padding': '21px'
  }
  return (
    <Router>
      <div className="sidebar">
          <ImageButton imageSrc={FriendImg} alt={'친구'} css={btnCss} link={'friend'}/>
          <ImageButton imageSrc={ChatImg} alt={'친구'} css={btnCss} />

          <Route exact path="/friend" component={FriendView}/>
      </div>
    </Router>
  );
}

export default Header;
